description:
Overview: Fade to Black chronicles the lives and deaths of more than 1,200 movie personalities, Included are not just the big stars but a wealth of important characters from the history of film. Some achieved world fame or great power. Some were consigned to obscurity after one scandal too many. Other hid dark secrets that would only emerge after their deaths. &lt;a href=&quot;
